# Lista para armazenar todos os jogadores de ambos os HTMLs
players = []

for html in [html1, html2]:
    soup = BeautifulSoup(html, "html.parser")
    
    for market in soup.find_all("div", title=True):
        name_tag = market.find("div", {"class": lambda x: x and "ChildMarketName" in x})
        # Busca TODAS as odds e pega a última (coluna "Mais de")
        odd_tags = market.find_all("div", {"class": lambda x: x and "OddValue" in x})
        
        if name_tag and odd_tags:
            # Pega a última odd encontrada (coluna "Mais de")
            odd_tag = odd_tags[-1]
            players.append({
                "nome": name_tag.get_text(strip=True),
                "odd": odd_tag.get_text(strip=True)
            })

# Salva no arquivo estrela.json
with open("estrela.json", "w", encoding="utf-8") as f:
    json.dump(players, f, ensure_ascii=False, indent=4)

print("Arquivo estrela.json criado com sucesso para os dois HTMLs!")
